import React, {useContext} from 'react';
import ItemContext from '../../../context/ItemContext/ItemContext';
import './ItemShopHistory.css';

const ItemShopHistory = () => {

    const iContext = useContext(ItemContext)

    const ShopHistory = iContext.item.shopHistory;

    return (
        <div>
            <table>
                <th>
                    <td>
                        Date
                    </td>
                </th>
                <tbody>
                    {iContext.item && iContext.item.shopHistory.reverse().map((appearance, i) => {
                        
                        const dateparsed = appearance.split('T')[0];
                        
                        return <tr><td>{dateparsed}</td></tr>
                    })}
                </tbody>
                {iContext.item && console.log(iContext.item.shopHistory.reverse())}
                {iContext.item && console.log(iContext.item.shopHistory)}
                {iContext.item && console.log(iContext.item.shopHistory.splice())}
            </table>
        </div>
    )
}

export default ItemShopHistory
